import React from 'react';
import logo from './logo.svg';

export default class ProductPage extends React.Component{
    render(){
        return(
            <div>
                <span >
                <img src={logo} style={{width: 150},{height: 150}}></img>

                </span>
            </div>
        )
    }
}
